import './App.css';
import Navbar from './components/Navbar'; // Import Navbar component
import Sidbar from './components/Sidbar'; // Import Sidebar component

function App() {
  return (
    <div className="App">
     <Navbar />
     <div className='row'>
      <div className='col-2 sidebar' >
        <Sidbar />
      </div>
      <div className='col-10'>
        <Routes />
        Home page </div>
      </div>
    </div>
  );
}

export default App;
